        <h2 class="heading-m">The best practice management platform for growing practices.</h2>
      </div>
      <div data-w-id="7f71010c-4268-6a0e-e3e3-b08c386a4272" style="opacity: 0;" class="card-margin">
        <div id="w-node-_7f71010c-4268-6a0e-e3e3-b08c386a4273-c0727d53" data-w-id="7f71010c-4268-6a0e-e3e3-b08c386a4273"
